import { Link} from 'react-router-dom';
const coursetest = () => {
  let cartItem={
    "cartItem":
    [
        {
            "id":5,
            "name":"blue berry",
            "inage":"image-dessert-1.jpg",
            "price":10,
            "description":"blue berry description",
            "quantity":3
        },
        {
            "id":4,
            "name":"watermelon",
            "inage":"image-dessert-2.jpg",
            "price":20,
            "description":"watermelon description",
            "quantity":5
        }
    ]
  }
  let { cartItem: items } = cartItem;
  let cartEmpty = items.length === 0;

  return (
    <div>
    {
        cartEmpty &&
        <div>    
            <Link to="/">part three</Link>
        </div>
    }
    {
        !cartEmpty &&
        <div>
            <div id="carSection">
                {
                    cartItems.map(product=>(
                        <div>
                        <img src={process.env.PUBLIC_URL+'/images/'+product.image}/>
                        {product.name}
                        {product.name}
                        {product.name}
                        </div>
                    ))
                }
            </div>
            <div id="checOutSection">
                Part two
            </div>
        </div>
    }
    </div>
  )
}

export default coursetest;
